tables.table_schema:
CREATE TABLE user_interactions (
  user_id UUID,
  interaction_type VARCHAR(50),
  timestamp TIMESTAMP,
  interaction_data JSONB
);

CREATE TABLE player_stats (
  user_id UUID,
  level INT,
  experience INT,
  items JSONB
);

CREATE TABLE user_interactions (
    user_id INT PRIMARY KEY,
    interaction_type VARCHAR(50),
    interaction_timestamp TIMESTAMP,
    interaction_duration INT
);

CREATE TABLE game_sessions (
    session_id INT PRIMARY KEY,
    user_id INT REFERENCES user_interactions(user_id),
    session_start TIMESTAMP,
    session_end TIMESTAMP
);

CREATE TABLE game_events (
    event_id INT PRIMARY KEY,
    session_id INT REFERENCES game_sessions(session_id),
    event_type VARCHAR(50),
    event_timestamp TIMESTAMP
);

CREATE TABLE Users (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    level INT NOT NULL,
    last_login TIMESTAMP NOT NULL
);

CREATE TABLE Levels (
    level_id UUID PRIMARY KEY,
    level_name VARCHAR(50) NOT NULL,
    difficulty INT NOT NULL,
    recommended_duration INTERVAL NOT NULL
);

CREATE TABLE Analytics (
    analytics_id UUID PRIMARY KEY,
    interaction_id UUID NOT NULL,
    analytics_data JSONB NOT NULL,
    analyzed_timestamp TIMESTAMP NOT NULL
);

CREATE TABLE Users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    registration_date DATE
);

CREATE TABLE Items (
    item_id INT PRIMARY KEY,
    item_name VARCHAR(100),
    item_type VARCHAR(50),
    item_description TEXT
);

CREATE TABLE Locations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(100),
    location_description TEXT,
    coordinates JSONB
);

CREATE TABLE Events (
    event_id INT PRIMARY KEY,
    event_name VARCHAR(100),
    event_type VARCHAR(50),
    event_timestamp TIMESTAMP
);
